import React, { useState } from 'react';
import { Link } from 'react-router-dom'; 
import '../components/Login.css'; 

function Login() {
    const [username, setUsername] = useState('');
    const [password, setPassword] = useState('');

    const handleLogin = (e) => {
        e.preventDefault();
        console.log(`Username: ${username}, Password: ${password}`);
    };

    return (
        React.createElement('div', { className: 'login-background' },
            React.createElement('div', { className: 'login-container' },
                React.createElement('form', { className: 'login-form', onSubmit: handleLogin },
                    React.createElement('h2', null, 'Inicio de Sesion'),
                    React.createElement('p', null, 
                        'Si ya tienes una cuenta inicia sesión, sino ',
                        React.createElement(Link, { to: '/Register' }, 'crea tu cuenta aquí')
                    ),
                    React.createElement('div', { className: 'input-container' },
                        React.createElement('input', {
                            type: 'text',
                            placeholder: 'Usuario',
                            value: username,
                            onChange: (e) => setUsername(e.target.value)
                        })
                    ),
                    React.createElement('div', { className: 'input-container' },
                        React.createElement('input', {
                            type: 'password',
                            placeholder: 'Contraseña',
                            value: password,
                            onChange: (e) => setPassword(e.target.value)
                        })
                    ),
                    React.createElement('button', { type: 'submit', className: 'login-button' }, 
                        'Ingresar ', React.createElement('span', null)
                    )
                )
            )
        )
    );
}

export default Login;
